Concern Global Gala: Unite to Fight Hunger is coming up in New York and Chicago, and we're excited to announce that this year's Tom Moran Humanitarian Award Honoree is...ALEXI LUBOMIRSKI!

@alexilubomirski is no stranger to @concernworldwide – he's been a supporter for over 20 years. As an established photographer in the fashion and beauty industry, Alexi has spent the previous 20 years photographing the world's most recognizable faces for magazines such as Vogue, Vanity Fair, Harpers' Bazaar, GQ, and Elle; and has shot campaigns for brands like Louis Vuitton, Michael Kors, Movado, Cover Girl, L'Oréal, Lancôme, and Maybelline. 

Off the set, in addition to his work with Concern, Alexi is a published poet and author, and a dedicated animal rights activist – and founder of the fashion movement, @creatives4change, which aims to end fur, feather, and exotic skin use in the industry. 

@alexilubomirskibooks has published a number of poetry, children's, and photography books. His most recent release, THE SITTINGS: 2003-2023, is an archive of his work highlighting 20 years of celebrity portraiture, including his work with @juliaroberts, Kate Winslet, @lupitanyongo, @jenniferaniston and The Royals, with all proceeds going to Concern. 

We're excited to honor Alexi for his dedication to Concern's mission, and we hope you'll join us for an unforgettable evening to experience an interactive journey with music, celebration of our 55th anniversary, and powerful stories from those on the front lines of the global food crisis!

